define(['jquery','Magento_Ui/js/modal/alert'],function($,alert){"use strict";$.widget('mage.monkeyapikey',{"options":{"apikeyUrl":""},_init:function(){var apiUrl=this.options.apikeyUrl;$('#stores_apikey').change(function(){$('#stores_list_id').empty();var apiKey=$('#stores_apikey').find(':selected').val();$.ajax({url:apiUrl,data:{'form_key':window.FORM_KEY,'apikey':apiKey,'encrypt':1},type:'POST',dataType:'json',showLoader:true}).done(function(data){if(data.valid==1){$.each(data.lists,function(i,item){$('#stores_list_id').append($('<option>',{value:item.id,text:item.name}));});}else{alert({content:data.errormsg});}});});}});return $.mage.monkeyapikey;});